export const fetchAP = () => {
    return (dispatch, getState) => {
      fetch('http://localhost:5000/api/unique_ap')
      .catch(err => {
        console.log(err)
        dispatch({
          type:"FETCH_APERROR",
          APerror: err,
          success: false
        })
      })
      .then(res => {
        return res.json()
      })
      .then(res => {
        if (res.error) {
          throw(res.error)
        }
        dispatch({
          type: "FETCH_APDATA",
          AP: res,
          success: true
        })
        return res;
      })
    }
}
